import React, { Component } from "react";
import { Link } from "react-router-dom";

export default class Register extends Component {
  render() {
    return (
      <form >
        <input type="text"/><br/>
        <input type="password"/><br/>
        <input type="submit" />
      </form>
    );
  }
}
